	(1,'rockpad_estimate_economy','Economy description text for RockPads','This foundation eliminates the 4\" 6\" pressure-treated border, the weed fabric and the rebar. It will be filled in with 5-6 inches of #5 clean stone which helps for quick drainage and insures that your structure remains level on top of the stone base.','2012-03-26 20:40:17','2012-03-26 20:40:17'),
	(2,'rockpad_estimate_standard','Standard Description Text for Rockpads','Excavation of area ensures that the top of the foundation will be even with the ground where the entrance of the structure will be located. 4\" 6\" pressure treated timbers are used for the border. \" 2\' rebar secures the border to the ground. Geotextile fabric is used to eliminate weed growth around the structure. The soil will be compacted to eliminate settling. This area will be filled in with 5-6 inches of #5 clean stone which helps for quick drainage and insures that your structure remains level on top of the stone base.','2012-03-26 20:40:38','2012-03-26 20:40:38'),
	(3,'rockpad_estimate_elite','Elite Description text for Rockpads','Excavation of area ensures that the top of the foundation will be even with the ground where the entrance of the structure will be located. 4\" 6\" pressure treated timbers are used for the border with 1\" 6\" Trex-composite capping on top of the border to enhance the beauty and extend the durability of the border.  \" 2\' rebar secures the border to the ground. Geotextile fabric is used to eliminate weed growth around the structure. The soil will be compacted to eliminate settling. This area will be filled in with 5-6 inches of #5 clean stone which helps for quick drainage and insures that your structure remains level on top of the stone base.','2012-03-26 20:41:00','2012-03-26 20:41:00'),
	(4,'rockpad_estimate_custom','Custom Description text for Rockpads','This foundation eliminates the 4\" 6\" pressure-treated border, the weed fabric and the rebar. The soil will be compacted to eliminate settling. It will be filled in with 5-6 inches of #5 clean stone which helps for quick drainage and insures that your structure remains level on top of the stone base.','2012-03-26 20:41:21','2012-03-26 20:41:21'),
	(5,'','swingset','6x6 pressure treated timber border secured to the ground with 1/2\"x2 rebar,\r\nGeotextile fabric eliminates weed groweth, certified playground mulch, drainage system keeps the area from puddling. Excavation of site.','2012-04-19 22:49:55','2012-04-19 22:49:55'),
	(7,'concrete_estimate_gibraltar','CMS data for gibraltar','This is a gibraltar slab. it is made of concrete. its hard.','2012-05-14 18:39:36','2012-05-14 18:39:36'),
	(8,'concrete_estimate_floating_slab','CMS data for floating slab','This is a floating piece of concrete. Its magical.','2012-05-14 18:41:59','2012-05-14 18:41:59'),
	(9,'concrete_estimate_graduated_slab','CMS data for graduated slab	','This is a graduated slab. I think its up to PhD by now.	','2012-05-14 18:42:25','2012-05-14 18:42:25'),
	(10,'concrete_estimate_concrete_piers','CMS data for concrete piers','Concrete piers are for the weak. the weak that can\'t hold up a building by themselves','2012-05-14 18:43:06','2012-05-14 18:43:06');
